import AppHeader from './components/AppHeader/AppHeader';
import Banner from './components/Banner/Banner';
import Feature from './components/Banner/Features/Feature/Feature';
import Features from './components/Banner/Features/Features';
function App() {
  return (
    <div className="App container">

     <AppHeader/>
     <Feature/>
     <Banner/>
     <Features/>



    </div>
  );
}

export default App;
